import { text } from "stream/consumers";

// typeを使うときは下記のように定義
type Item = {
  key: string;
  text: string; 
  done: boolean;
}

const getKey = (): string => Math.random().toString(32).substring(2);

const item: Item = {
  key: getKey(),
  text: 'Learn JavaScript',
  done: false,
};

// 関数で変数を定義するときは引数にオブジェクトの型を指定
export function TodoItem(item: Item) {
  return (
    <label className="panel-block">
      <input type="checkbox" />
      {item.text}
    </label>
  );
}
